import TemplateOne from './Components/templates/TemplateOne';

const App = () => {
  const sampleData = {
    name: "Anshdeep Thakur",
    role: "Full Stack Developer",
    summary: "Passionate developer with experience in building and deploying scalable applications. Skilled in MERN stack and cloud technologies. Constantly learning and improving.",
    contact: {
      email: "anshdeep@example.com",
      phone: "+91-1234567890",
      linkedin: "https://www.linkedin.com/in/anshdeep/",
      github: "https://github.com/anshdeep"
    },
    skills: [
      "JavaScript", 
      "React", 
      "Node.js", 
      "MongoDB", 
      "Express.js", 
      "HTML5", 
      "CSS3", 
      "Git", 
      "REST APIs"
    ],
    experience: [
      {
        company: "Tech Corp",
        role: "Backend Developer",
        duration: "Jun 2024 - Present",
        description: "Developed and maintained APIs for a cloud-based inventory management system. Integrated payment gateways and managed server-side logic."
      },
      {
        company: "Dev Solutions",
        role: "Full Stack Intern",
        duration: "Jan 2024 - May 2024",
        description: "Worked on front-end features using React and Node.js for the backend. Collaborated in a team of 5 to build a project management web application."
      }
    ],
    education: [
      {
        institution: "Chitkara University",
        degree: "B.Tech in Computer Science Engineering",
        duration: "2022 - 2026"
      },
      {
        institution: "XYZ School",
        degree: "High School",
        duration: "2020 - 2022"
      }
    ]
  };

  return (
    <div>
      <TemplateOne data={sampleData} />
    </div>
  );
};

export default App;
